INSERT INTO `sz_posts` VALUES (1,1,'2016-07-08 14:26:46','2016-07-08 14:26:46','Welcome to WordPress. This is your first post.','Hello world!','','publish','open','open','','hello-world','','','2016-07-16 21:10:35','2016-07-16 21:10:35','',0,'http://vagrant.local/?p=1',0,'post','',1),(2,1,'2016-07-08 14:26:46','2016-07-08 14:26:46','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\r\n\r\n...or something like this:\r\n\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\n\r\nAs a new WordPress user, you should go to <a href=\"http://vagrant.local/wp/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2016-07-08 14:26:46','2016-07-08 14:26:46','',0,'http://vagrant.local/?page_id=2',0,'page','',0),(3,1,'2016-07-08 14:29:20','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2016-07-08 14:29:20','0000-00-00 00:00:00','',0,'http://vagrant.local/?p=3',0,'post','',0),(4,1,'2016-07-08 15:06:32','2016-07-08 15:06:32','Welcome to WordPress. This is your first post.','Hello world!','','inherit','closed','closed','','1-revision-v1','','','2016-07-08 15:06:32','2016-07-08 15:06:32','',1,'http://vagrant.local/2016/07/08/1-revision-v1/',0,'revision','',0),(5,1,'2016-07-13 23:10:01','2016-07-13 23:10:01','Welcome to WordPress. This is your first post.1111111111111','Hello world!','','inherit','closed','closed','','1-revision-v1','','','2016-07-13 23:10:01','2016-07-13 23:10:01','',1,'http://vagrant.local/2016/07/13/1-revision-v1/',0,'revision','',0),(6,1,'2016-07-16 21:10:35','2016-07-16 21:10:35','Welcome to WordPress. This is your first post.','Hello world!','','inherit','closed','closed','','1-revision-v1','','','2016-07-16 21:10:35','2016-07-16 21:10:35','',1,'http://vagrant.local/2016/07/16/1-revision-v1/',0,'revision','',0);
